import React, { useState, useEffect } from 'react';
import axios from 'axios';

const QuestionsForm = () => {
  const [text, setText] = useState("");
  const [questions, setQuestions] = useState([]);
  const [selected, setSelected] = useState({});
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetchQuestions();
  }, []);

  const fetchQuestions = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/questions');
      setQuestions(res.data);
      setSelected({});
    } catch (error) {
      setMessage("Erreur lors du chargement des questions.");
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!text.trim()) return;

    try {
      await axios.post("http://localhost:5000/api/questions", { text });
      setMessage("✅ Question ajoutée avec succès !");
      setText("");
      fetchQuestions();
    } catch (error) {
      setMessage("❌ Erreur lors de l'ajout.");
    }
  };

  const toggleSelect = (id) => {
    setSelected(prev => ({
      ...prev,
      [id]: !prev[id],
    }));
  };

  const deleteSelected = async () => {
    const idsToDelete = Object.entries(selected)
      .filter(([_, isChecked]) => isChecked)
      .map(([id]) => id);

    if (idsToDelete.length === 0) {
      setMessage("Veuillez sélectionner au moins une question à supprimer.");
      return;
    }

    try {
      await axios.delete('http://localhost:5000/api/questions', { data: { ids: idsToDelete } });
      setMessage(`✅ ${idsToDelete.length} question(s) supprimée(s) avec succès.`);
      fetchQuestions();
    } catch (error) {
      setMessage("Erreur lors de la suppression des questions.");
    }
  };

  return (
    <div style={containerStyle}>
      <h2>Ajouter une Question</h2>
      <form onSubmit={handleSubmit} style={formStyle}>
        <textarea
          rows={4}
          value={text}
          onChange={(e) => setText(e.target.value)}
          placeholder="Écris ta question ici"
          style={textareaStyle}
          required
        />
        <button type="submit" style={buttonStyle}>Ajouter</button>
      </form>

      {message && <p style={messageStyle}>{message}</p>}

      <h2 style={{ marginTop: '40px' }}>Liste des Questions</h2>
      <button onClick={deleteSelected} style={deleteButtonStyle}>Supprimer la sélection</button>
      <ul style={listStyle}>
        {questions.map(q => (
          <li key={q.id} style={itemStyle}>
            <input
              type="checkbox"
              checked={!!selected[q.id]}
              onChange={() => toggleSelect(q.id)}
              style={{ marginRight: '10px' }}
            />
            {q.text}
          </li>
        ))}
      </ul>
    </div>
  );
};

const containerStyle = {
  maxWidth: '600px',
  margin: '0 auto',
  padding: '20px',
  backgroundColor: '#f9faff',
  borderRadius: '10px',
  boxShadow: '0 2px 10px rgba(0,0,0,0.05)',
  fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
};

const formStyle = {
  display: 'flex',
  flexDirection: 'column',
  gap: '15px',
};

const textareaStyle = {
  padding: '10px',
  fontSize: '16px',
  borderRadius: '8px',
  border: '1.5px solid #ccc',
  resize: 'vertical',
  minHeight: '100px',
  fontFamily: 'inherit',
};

const buttonStyle = {
  backgroundColor: '#007bff',
  color: '#fff',
  fontWeight: 'bold',
  border: 'none',
  padding: '12px',
  borderRadius: '8px',
  cursor: 'pointer',
  fontSize: '16px',
  transition: 'background-color 0.3s',
};

const messageStyle = {
  marginTop: '15px',
  fontWeight: 'bold',
  color: '#333',
};

const deleteButtonStyle = {
  marginBottom: '15px',
  padding: '8px 16px',
  backgroundColor: '#dc3545',
  color: '#fff',
  border: 'none',
  borderRadius: '6px',
  cursor: 'pointer',
};

const listStyle = {
  listStyle: 'none',
  paddingLeft: 0,
};

const itemStyle = {
  marginBottom: '10px',
  fontSize: '16px',
};

export default QuestionsForm;
